DROP TABLE IF EXISTS `notifications`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `notifications` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `title` varchar(255) NOT NULL,
  `body` text NOT NULL,
  `type` varchar(255) NOT NULL,
  `data_id` bigint(20) unsigned NOT NULL,
  `data_type` varchar(255) NOT NULL,
  `resident_id` bigint(20) unsigned NOT NULL,
  `social_assistance_recipient_id` bigint(20) unsigned NOT NULL,
  `social_assistance_id` bigint(20) unsigned NOT NULL,
  `is_read` tinyint(1) NOT NULL DEFAULT 0,
  `created_at` timestamp NOT NULL DEFAULT current_timestamp(),
  `updated_at` timestamp NOT NULL DEFAULT current_timestamp() ON UPDATE current_timestamp(),
  PRIMARY KEY (`id`),
  KEY `notifications_resident_id_foreign` (`resident_id`),
  KEY `notifications_social_assistance_recipient_id_foreign` (`social_assistance_recipient_id`),
  KEY `notifications_social_assistance_id_foreign` (`social_assistance_id`),
  CONSTRAINT `notifications_resident_id_foreign` FOREIGN KEY (`resident_id`) REFERENCES `residents` (`id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `notifications_social_assistance_id_foreign` FOREIGN KEY (`social_assistance_id`) REFERENCES `social_assistances` (`id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `notifications_social_assistance_recipient_id_foreign` FOREIGN KEY (`social_assistance_recipient_id`) REFERENCES `social_assistance_recipients` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=118 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;
